import React, { Component } from "react";
import { connect } from "react-redux";
import { TextInput, Button, Row } from "react-materialize";

function mapStateToProps(state) {
  return {};
}

class StatusForm extends Component {
  render() {
    return (
      <div>
        <form>
          <Row>
            <TextInput s={12} m={6} xl={6} l={6} label="Title:" name="title" />
            <TextInput s={12} m={6} xl={6} l={6} label="Color:" name="color" />
          </Row>
          <Row>
              <Button className="gradient-btn btn-green">
                  Save
              </Button>
          </Row>
        </form>
      </div>
    );
  }
}

export default connect(mapStateToProps)(StatusForm);
